class Junction:
    def __init__(self, index):
        self.index = index
        self.neighbors = []
        self.product_count = 0

    def add_neighbor(self, junction):
        self.neighbors.append(junction)

class Factory:
    def __init__(self, N, K, M):
        self.N = N
        self.K = K
        self.M = M
        self.junctions = [Junction(i) for i in range(1, N + 1)]
        self.conveyor_belts = []

    def add_conveyor_belt(self, a, b):
        self.conveyor_belts.append(ConveyorBelt(a, b))

    def remove_producer(self, junction):
        for belt in self.conveyor_belts:
            if belt.product and belt.a == junction.index:
                belt.product = None

    def max_active_producers(self):
        for belt in self.conveyor_belts:
            if belt.product:
                belt.product.product_count += 1

        max_active_producers = 0
        for junction in self.junctions:
            if junction.product_count > max_active_producers:
                max_active_producers = junction.product_count

        return max_active_producers

